import { Facebook, Instagram, Pinterest, Twitter } from '@material-ui/icons';
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
display: flex;
`;

const Left = styled.div`
flex:1 ;
display: flex;
flex-direction: column;
padding: 10px;
`;

const Logo = styled.h1`
`;

const Desc = styled.p`
margin: 20px 0px;
`;

const SocialContainer = styled.div`
display: flex;
`;

const SocialIcon = styled.div`
width: 40px;
height: 40px;
border-radius: 50%;
display: flex;
align-items: center;
justify-content: center;
margin-right: 22px;
background-color: #${props => props.color};
color: white;
`

const Center = styled.div`
flex: 1;
padding: 10px;
`;

const Title = styled.h3`
margin-bottom: 20px;
`;

const List = styled.ul`
margin: 0;
padding: 0;
`;

const ListItem = styled.li`
`

const Right = styled.div`
flex: 1;
padding: 10px;
`
const Footer = () => {
    return (
        <Container>
            <Left>
                <Logo>MOTO BIKE</Logo>
                <Desc>
                    Magazin pe piese de motociclete,scutere, atv si motoutilaje, vanzare de scutere si atv-uri, reparatia ÅŸi intretinerea acestora. Aici gasesti o gama completa de piese pentru motorul tau.. Piese de cea mai buna calitate la cel mai bun pret si piese pe OEM - original direct de la fabrica.
                </Desc>
                <SocialContainer>
                    <SocialIcon color="E60023">
                        <Pinterest />
                    </SocialIcon>
                    <SocialIcon color="55ACEE">
                        <Twitter />
                    </SocialIcon>
                    <SocialIcon color="3B5999">
                        <Facebook />
                    </SocialIcon>
                    <SocialIcon color="E4405F">
                        <Instagram />
                    </SocialIcon>
                </SocialContainer>
            </Left>
            <Center>
                <Title>Link-uri utile</Title>
                <List>
                    <ListItem>Home</ListItem>
                    <ListItem>Cos</ListItem>
                    <ListItem>Piese</ListItem>
                    <ListItem>Vehicule</ListItem>
                    <ListItem>Accesorii casti</ListItem>
                    <ListItem>Favorite</ListItem>
                    <ListItem>Termeni si conditii</ListItem>
                    <ListItem>Cum cumpar</ListItem>
                    <ListItem>Livrare</ListItem>
                    <ListItem>Contact</ListItem>
                </List>
            </Center>
            <Right></Right>
        </Container>
    )
}

export default Footer
